import React from 'react';
import '@axa-ch/button'
import '@axa-ch/table-sortable';


export default function TranslationTable() {


        function mapTranslationToTableRow() {
            // @ts-ignore
            return (
                <axa-table-sortable>
                    <table>
                        <thead>
                        <tr>
                            <th>Titel 1</th>
                            <th>Titel 2</th>
                            <th>Titel 3</th>
                            <th>Titel 4</th>
                        </tr>
                        </thead>
                    </table>
                </axa-table-sortable>
            );
        }


        return (
            <axa-table-sortable>
                <table>
                    <thead>
                    <tr>
                        <th>Titel 1</th>
                        <th>Titel 2</th>
                        <th>Titel 3</th>
                        <th>Titel 4</th>
                    </tr>
                    </thead>
                </table>
            </axa-table-sortable>
        );
}
